pragma solidity ^0.4.23;

import "./ERC721Token.sol";
contract Cat is ERC721Token{
  uint public itemNum;
  mapping(uint => Item) public items;
  struct Item{
    uint id;
    uint value;
  }

  constructor(string _name, string _symbol)public {
    name_ = _name;
    symbol_ = _symbol;
    setItem(1,25000000000000000000); //lambo  25eth
    setItem(1,20000000000000000000); //house  20eth
    setItem(1,15000000000000000000); //spa    15eth
    setItem(1,10000000000000000000); //toy    10eth
    setItem(1,10000000000000000000); //jewelery 10eth
    setItem(1,5000000000000000000); //tuna    5eth
    setItem(1,10000000000000000); //cat food  0.01eth

  }

  function setItem(uint _id, uint _value)public{
    Item memory newItem = Item({
      id: _id,
      value: _value
    });
    items[_id] = newItem;
  }
}
